script: |
  super -f tsv -I q306.sql | sort > q306.out

vector: true

inputs:
  - name: q306.sql
    data: |
      SELECT DISTINCT + col2 FROM tab1 WHERE NOT ( NOT ( NOT col1 * - - 47 IN ( col2 / - col0, ( - col2 ) + col2 + 59 ) ) );
  - name: tab1

outputs:
  - name: q306.out
    data: |
      59
      68
      96
